        "System.Description": "When a physical deposit slip is scanned in the Vsoft Dialog in a DDA and Deferred transaction, VSoft will return a value to notify Zeus to NOT to generate checking deposit virtual ticket (credit virtual ticket).\n<span style=\"display:inline !important;\">Only Pre printed Deposit tickets are allowed for these transactions.&nbsp;</span><div><div><br>This will be a .dll change in Zeus and there is a Vsoft change on this enhancement request as well.&nbsp;</div><div><br></div><div>Steps:</div><div><br></div><div>1- Input account number from the deposit slip on the transaction screen.</div><div>2- Hit scan button&nbsp;</div><div>3- On the Vsoft scan check dialog select &quot;Physical Deposit Ticket&quot; from the drop down</div><div>4- Scan deposit ticket FIRST making sure it has any cash in/out amounts accounted for in the total&nbsp;</div><div>5- Scan checks and Submit</div><div>6- Complete the transaction</div><div><br><hr>Reporter: Mohammed Mohiuddin<hr>External ID: 1912<hr>Components: <hr>Affiliates affected: NBA,NSB,VBC,ZFNB,ABT,CBT<hr>Original assignee: Trung Thai<hr>Found with a Test Case</div></div>",
